script: |
  super -f text -I q605.spq | sort > q605.out

inputs:
  - name: q605.spq
    data: |
      SELECT DISTINCT - col0 + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 - + 21 + col2 * - col1 + + - col1 <> + col2 / - + col0;
  - name: tab1

outputs:
  - name: q605.out
    data: |
      -37
      -44
      -80
